Vaishali is married to Kumar who has a job in Paris and is very happy about it. Kumar takes her to Paris as his sister and shows her around and Vaishali is ecstactic about her married life. The she starts suspecting Kumars relation with the landlady, Lucy, who turns out to be Kumars wife. Sorely disappointed Vaishali now with child, returns to India to her brother with the help of some Indian friends.
